import React from 'react';

import './Software.css';

import btcover from "./../../assets/bt-cover.png";
import sccover from "./../../assets/sc-cover.png";
import bdabcover from "./../../assets/bdab-cover.png";
import spotifycover from "./../../assets/spotify-cover.png";
import bpdatacover from "./../../assets/bpdata-cover.png";

import RectanglePolaroid from './../../components/RectanglePolaroid'

function Software() {
    var sproul = <img className="image" src={sccover}></img>
    var spotify = <img className="image" src={sccover}></img>
    var blueprint = <img className="image" src={sccover}></img>

  return (
    <div class="software">
        <div class="text-container">
            <text class="big-text">software</text>
            <text class="small-text"></text>
        </div>
        <div class="links-container">
            <div class="row">
                <RectanglePolaroid title="frontend engineer" subtitle="sproul.club" image={sproul}> </RectanglePolaroid>
                <RectanglePolaroid title="machine learning research" subtitle="" image={spotify}> </RectanglePolaroid>
                <RectanglePolaroid title="" subtitle="" image={blueprint}> </RectanglePolaroid>
            </div>
        </div>
    </div>
  );
}

export default Software;
